import ReactDOM from 'react-dom/client';
import AuthContext, { AuthContextProvider } from "./store/auth-context";

import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <AuthContextProvider>
        <App />
    </AuthContextProvider>
);
